apps.description:
Borzo (ex WeFast; https://borzodelivery.com/in) is the business delivery you can trust — fast intracity courier delivery service. 
Delivering 4 million packages a month in 10 countries.

Place an order in seconds, and your customers will receive their items: 

- The same day: up to 90 minutes, at a specified time or in the time interval;
- At the scheduled date and time.

Delivery with BORZO courier service:
- Order delivery in a couple of clicks via plain forms on the user-friendly app and website;
- Thousands of top-rated trusted couriers with cars in our urgent delivery app;
- Professional courier tracking app: track orders on the map and see the estimated delivery time;
- Safety and speed. All parcels are handled with extra care and delivered on time. Totally reliable delivery service;
- Care for recipients. A delivery experience designed for your customers’ satisfaction — they are more likely to order from you again for their next delivery;
- The fast delivery service: the most efficient delivery route is automatically built by the app.

Borzo (ex WeFast) is an urgent delivery app for ecom express orders. Instant delivery/pick up. 1 day delivery shopping app for your clients & shipping for business. The local app for quick porter delivery via bike ride or delivery car across town or neighbourhood. Grocery shopping, flower, food and drinks home delivery. 

BORZO knows how to help any type of buisness or store:
- E-shop items & ecom express;
- Documents (delivered in a document file folder);
- Clothes, shoes and lifestyle stores;
- Food, groceries and many more supermarket items;
- Flowers, gifts and cake delivery;
- Pharma goods;
- Restaurants (with and without a food delivery app);
- Packers and movers app (we provide a truck or a car);
- any other business.

Different payment methods:
- Pay by cash; 
- Card-to-card transfer;
- With your Borzo credit balance or wallet.

You can pay for express delivery with cash, by wire transfer from your business account, or by card-to-card transfer directly to the courier. Price is calculated online right in the app. 

Smart and easy logistics solutions designed for your convenience:
- Flexible timing;
- 24/7 express delivery & quik delivery express app;
- Combined orders;
- Attentive support;
- Money guarantee.

Support. Customer service representatives can help you with order status, advise on the best delivery type, explain how our service works and why we have the best couriers. 
If you have any questions or comments about our service, drop us a note:

- India: support.client.in@borzodelivery.com 
- Philippines: support.client.ph@borzodelivery.com 
- Indonesia: support.client.id@borzodelivery.com 
- Brazil: support.client.br@borzodelivery.com 
- Vietnam: support.client.vn@borzodelivery.com 
- Malaysia: support.client.my@borzodelivery.com 
- Mexico: support.client.mx@borzodelivery.com 
- Korea: support.client.kr@borzodelivery.com

Borzo is a new app formerly known as WeFast, We Fast delivery, V Fast, Mr.Speedy, MrSpeedy or simply We app. Safe delivery app for your next delivery — get Borzo app now!

If you want to become a delivery rider, check out our courier app: Borzo Delivery Partner.

